class Solution {
  int maxFrequencyElements(List<int> nums) {
    // Create a map to store the frequency of each element
    var frequencyMap = <int, int>{};

    // Loop through the array and count the frequency of each element
    for (int num in nums) {
      frequencyMap[num] = (frequencyMap[num] ?? 0) + 1;
    }

    // Find the maximum frequency
    int maxFrequency = frequencyMap.values.reduce((a, b) => a > b ? a : b);

    // Count the total occurrences of elements with the maximum frequency
    int count = 0;
    for (var frequency in frequencyMap.values) {
      if (frequency == maxFrequency) {
        count += frequency;
      }
    }

    return count;
  }
}
